             "resets the gimbal. the behaviors are product-dependent. osmo series (e.g. osmo, osmo pro):  the gimbal's pitch and yaw will be set to the origin, which is the standard position for  the gimbal. phantom series (e.g. phantom 3 professional, phantom 4 series): the first call  sets gimbal to point down vertically to the earth. the second call sets gimbal to the  standard position. other products (e.g. inspire 1): only the gimbal's pitch will the set  to the origin.  @param completion remote execution result error block.",
