             "startbalancetestwithcompletion",
             "starts testing the balance of the gimbal payload. for gimbals that allow payloads to be  changed, a balance test should be performed to ensure the camera is mounted correctly.  the product should be stationary (not flying, or being held) and horizontal during testing.  see `djigimbalstate` for the test result.  @param completion completion block that receives the execution result. the completion block will return  when the balance test is successfully started.",
