             "applymotorcontrolpreset:withcompletion",
             "configures gimbal's motor control with a preset configuration applicable for most popular  cameras. in order to the optimize the performance, motor control tuning is still required.  @param preset the preset configuration to set. @param completion the completion block that receives execution result.",
             "setmotorcontrolstiffness:onaxis:withcompletion",
             "sets the coefficient of speed error control. it can be seen as the coefficient for the  proportional term in the pid controller. use `djigimbalparampitchmotorcontrolstiffness`, `djigimbalparamyawmotorcontrolstiffness`  and `djigimbalparamrollmotorcontrolstiffness` with `capabilities`  to check if the gimbal supports this feature and the range of possible values (unitless).  @param stiffness the stiffness value to set. @param axis the axis that the setting is applied to. @param completion the completion block that receives execution result.",
             "getmotorcontrolstiffnessonaxis:withcompletion",
             "gets the coefficient of speed error control. it can be seen as the coefficient for the proportional term in  the pid controller. use `djigimbalparampitchmotorcontrolstiffness`, `djigimbalparamyawmotorcontrolstiffness`  and `djigimbalparamrollmotorcontrolstiffness` with `capabilities` to check if the gimbal  supports this feature and the range of possible values (unitless).  @param axis the axis to query. @param stiffness the proportional term in the pid controller. @param error error retrieving the value. @param completion the completion block that receives execution result.",
