             "setmotorcontrolgyrofilteringfactor:onaxis:withcompletion",
             "sets the coefficient of denoising the output.  use `djigimbalparampitchmotorcontrolgyrofilteringfactor`, `djigimbalparamyawmotorcontrolgyrofilteringfactor`  and `djigimbalparamrollmotorcontrolgyrofilteringfactor` with `capabilities` to check if the gimbal supports this feature and the range of possible values (unitless).  @param filteringfactor the gyro filtering value to set. @param axis the axis that the setting is applied to. @param completion asynchronous execution result.",
             "getmotorcontrolgyrofilteringfactoronaxis:withcompletion",
             "gets the coefficient of denoising the output.  use `djigimbalparampitchmotorcontrolgyrofilteringfactor`, `djigimbalparamyawmotorcontrolgyrofilteringfactor`  and `djigimbalparamrollmotorcontrolgyrofilteringfactor` with `capabilities` to check if the gimbal supports this feature and the range of possible values (unitless).  @param axis the axis to query. @param filteringfactor the smoothing factor. @param error error retrieving the value. @param completion the completion block that receives execution result.",
             "setmotorcontrolprecontrol:onaxis:withcompletion",
             "sets the value for pre-adjust. it can be seen as the coefficient for the derivative term in the pid controller. use `djigimbalparampitchmotorcontrolprecontrol`, `djigimbalparamyawmotorcontrolprecontrol` and `djigimbalparamrollmotorcontrolprecontrol` with `capabilities` to check if the gimbal supports this feature and the range of possible values (unitless).  @param axis the axis that the setting is applied to. @param precontrol the precontrol value to set. @param completion asynchronous execution result.",
             "getmotorcontrolprecontrolonaxis:withcompletion",
             "gets the value for pre-adjust. it can be seen as the coefficient for the derivative term in the  pid controller. only supported by ronin-mx. use `djigimbalparampitchmotorcontrolprecontrol`, `djigimbalparamyawmotorcontrolprecontrol`  and `djigimbalparamrollmotorcontrolprecontrol` with `capabilities` to check if the gimbal supports this feature and the range of possible values (unitless).  @param axis the axis to query. @param precontrol the derivative term in the pid controller. @param error error retrieving the value. @param completion the completion block that receives execution result.",
             "setcontrollerdeadband:onaxis:withcompletion",
