             "setdisablecountrycodecheck",
             "the sdk will automatically try to determine the country in which the product is operating and decide  the behaviour accordingly. the process of determining in which country the product is flying uses  location information. this method can be used to disable this check, but must be called before `registerappwithdelegate` to take effect. influenced features includes:  - some products (e.g.  mavic pro, inspire 2, phantom 4 pro) make use of both 2.4 ghz and 5 ghz spectrums for wireless  communication. while 5 ghz will not necessarily have the same range as 2.4 ghz, it can be useful  if the 2.4 ghz band has a lot of existing interference. however, as some countries do not permit  the use of the 5 ghz spectrum. if country code check is disabled, only 2.4 ghz will be available  as an option.  - `appactivationmanager` uses country information to  determine whether the user needs to log into their dji account to activate the application. if  the country code check is disabled, the user will need to log into their dji account by default.  @param disablecountrycodecheck `yes` if the country code check is disabled.",
             "useraccountmanager",
             "used to manage the dji account of users. login is required by `djiflyzonemanager`  and `djiappactivationmanager`.  @return a instance of `djiuseraccountmanager`.",
