             "product",
             "the dji product which is connected to the mobile device, only available after successful registration of the app.  @return a instance of `djibaseproduct`.",
             "bluetoothproductconnector",
             "used to establish the bluetooth connection between the mobile device and the dji product. the bluetooth connection needs to be established before a connection between the sdk and the dji product can be made using `startconnectiontoproduct`.  @return a `djibluetoothproductconnector` instance.",
             "startconnectiontoproduct",
             "starts a connection between the sdk and the dji product. this method should be called  after successful registration of the app and once there is a data connection between the mobile device and dji product. this data connection is either a usb cable connection, a wifi connection (that needs to be established outside of the sdk) or a bluetooth connection (that needs to be established with `bluetoothproductconnector`). if the connection succeeds, `productconnected` will be called if the connection succeeded. returns `yes` if the connection is started successfully. for products which connect to the mobile device using bluetooth, `bluetoothproductconnector` should be used to get a `djibluetoothproductconnector` object which can handle bluetooth device connection.  @return `yes` if the connection is started successfully.",
             "stopconnectiontoproduct",
             "disconnect from the connected dji product.",
             "closeconnectionwhenenteringbackground",
             "set the sdk to close the connection automatically when the app enters the background, and resume connection  automatically when the app enters the foreground. default is `yes`.  @param isclose `yes` if the connection should be closed when entering background.",
             "enablebridgemodewithbridgeappip",
             "enter debug mode with debug ip.  @param bridgeappip debug ip of the dji bridge app.",
             "enableremoteloggingwithdeviceid:logserverurlstring",
             "enable remote logging with log server url.  @param deviceid optional device id to uniquely identify logs from an installation. @param url url of the remote log server.",
             "archivelogs",
             "the dji mobile sdk collects logs that are related to flight. these logs can be used to help diagnose the cause  of a product's flight failure at the sdk and mobile application layers. they are predominantly used by a dji  service facility, who will combine them with the product's flight logs (stored on the product) to better  understand the root cause of a crash and determine whether the incident is covered under warranty. they can  also be used by developers to debug their application. sdk logs record commands from the application to the sdk, and information from the sdk to the application that are related to flight. logs are cached to the mobile  device, and will overwrite themselves to limit storage footprint. `archivelogs` will move the logs to an archive  folder. logs in the archive, will only be overwritten by newer archives that go beyond the storage limit and not  normal log generation. the storage limit for normal log generation is 400 mb (about 500 minutes of flight). the  storage limit for the archive is an additional 400 mb. the logs have an encrypted and unencrypted portion. the  unencrypted portion can be used by developers to see all commands and information sent to and received from the  sdk by the mobile application that is related to flight. the encrypted portion can only be used by a dji service  facility as it includes proprietary hardware protocols and is used to tie the sdk logs and product flight logs  together. logs can be transferred to the dji service facility either by manually downloading from the mobile  device using itunes, or the application can send archived logs to a dji endpoint using `uploadarchivedlogs`.  developers should be careful to upload logs directly when the user is on a cellular connection as the archive  can be up to 400 mb. return path of archived logs, nil if a problem occurred.  @return an nsstring object for the archive logs.",
             "uploadarchivedlogs",
             "upload the archive to dji. the archive will not be deleted when calling this method.",
