             "logintodjiuseraccountwithauthorizationrequired:withcompletion",
             "after invoking this method, a dialog redirecting users to log into their dji account  will be shown. for users outside of china, authorization is required to unlock  authorization zones. after the login process, if `authorizationrequired` is `yes`,  and the user is currently out of china and the account has not been authorized to  unlock authorization zones, the dialog will then redirect users to authorize their account.  @param authorizationrequired `yes` if authorization is required. @param completion the execution block with the returned execution result.",
