             "selects the channel number. the ocusync link operates on a  10 mhz or 20 mhz channel between 2400.5 mhz and 2482.5 mhz. the channel can be centered at 1 mhz steps within the  band. therefore for a 10 mhz bandwidth, the ocusync channel can be centered at 2405.5 mhz, 2406.5 mhz and every 1  mhz to 2477.5 mhz. for a 20 mhz bandwidth, channel center can be at 2410.5 mhz to 2472.5 mhz in 1 mhz steps. the  channel location within the band is specified using the channel number. channel number is defined as the integer  of 0.5 mhz less than the channel center frequency. e.g. channel number 2406 represents the 10 mhz channel centered  at 2406.5 mhz (this is only for the 10 mhz bandwidth as 20 mhz bandwidth channels start at 2410.5 mhz). channel  number 2450 represents the channel centered at 2450.5 mhz (of any bandwidth).  use `getchannelnumbervalidrangewithcompletion` to check the valid channel numbers for a given bandwidth. channel  number can only be set when the channel selection mode is `djiocusyncchannelselectionmodemanual`.  @param channelnumber channel number to set ocusync channel to. @param completion completion block that receives the setter result.",
             "getchannelnumberwithcompletion",
