             "gets if the recording of raw video is enabled. it is supported by x5s.  @param enabled the enabled value. @param error error retrieving the value. @param completion completion block to receive the result.",
             "setssdvideoresolutionandframerate:withcompletion",
             "set raw video resolution and frame rate of the ssd. note, only raw video is saved to the ssd.  compressed video, compressed pictures and raw pictures are all saved to the sd card. during  video capture, raw video and compressed video are saved simultaneously to the ssd and sd card  respectively. @warning the supported resolutions and frame rates for ssd raw videos are shown  below:  <b>ntsc:</b>  resolution_4096x2160, framerate_24fps  resolution_3840x2160,  framerate_24fps  resolution_3840x2160, framerate_30fps  resolution_2704x1520, framerate_24fps   resolution_2704x1520, framerate_30fps  resolution_1920x1080, framerate_60fps  resolution_1920x1080,  framerate_48fps  resolution_1920x1080, framerate_30fps  resolution_1920x1080, framerate_24fps  <b>pal:</b>  resolution_4096x2160, framerate_25fps  resolution_4096x2160, framerate_24fps  resolution_3840x2160, framerate_25fps  resolution_3840x2160, framerate_24fps  resolution_2704x1520,  framerate_25fps  resolution_2704x1520, framerate_24fps  resolution_1920x1080, framerate_50fps   resolution_1920x1080, framerate_48fps  resolution_1920x1080, framerate_25fps  resolution_1920x1080, framerate_24fps  for x5s, the frame rate of ssd has to be the same as the video to be stored in sd card, so framerate</code> is ignored. the possible resolutions are determined by sd card video's frame rate and the ssd video license (`djicamerassdvideolicense`) being used. the supported resolutions in  the current configuration can be queried by using `ssdvideoresolutionrange` in `djicameracapabilities`.  @param resolutionandframerate resolution and frame rate to be set for the video. @param completion remote execution result error block.",
             "getssdvideoresolutionandframeratewithcompletion",
             "get raw video format and frame rate of the ssd.  @param resolutionandframerate the `djicameravideoresolutionandframerate` object. @param error error retrieving the value. @param completion completion block to receive the result.",
             "setssdvideodigitalfilter:withcompletion",
             "sets the digital filter for video that will be stored in ssd. it is only applied when the selected license key is either `djicamerassdvideolicenseprores422hq` or `djicamerassdvideolicenseprores4444xq`. only supported by inspire 2.  @param filter ssd digital filter to set. @param completion completion block that receives the setter result.",
             "getssdvideodigitalfilterwithcompletion",
             "gets the digital filter for video that will store in ssd. only supported by inspire 2.  @param filter the value of the `djicamerassdvideodigitalfilter` enum. @param error error retrieving the value. @param completion completion block to receive the result.",
             "getssdvideolicenseswithcompletion",
             "gets purchased license key(s). an inspire 2 license key activates the usage permission of  cinemadng or apple prores inside cinecore 2.0. user can purchase a license key on dji's  website. it is supported by inspire 2. the digital filter for video that will store in ssd.  only supported by inspire 2.  @param licenses the array of licenses number. @param error error retrieving the value. @param completion completion block to receive the result.",
             "activatessdvideolicense:withcompletion",
