             "setfileindexmode:withcompletion",
             "sets the camera's file index mode for the sd card. the default value of `djicamerafileindexmode`  is set to `djicamerafileindexmodereset`.  @param mode file index mode to be set for the camera's sd card. @param completion remote execution result error block.",
             "getfileindexmodewithcompletion",
