             "formatsdcardwithcompletion",
             "formats the sd card by deleting all the data on the sd card. this does not change any settings the user may have  set on the sd card.  @param completion remote execution result callback block.",
             "isssdsupported",
             "determines whether the ssd is supported by the camera. currently, the ssd is supported only by x5r, x4s and x5s  camera. @return `yes` if ssd is supported, otherwise `no`.  @return a boolean value.",
             "formatssdwithcompletion",
             "formats the ssd by deleting all the data on the ssd. this does not change any settings the user may have set on the ssd.  @param completion the execution callback with the returned execution result.",
             "setantiflickerfrequency:withcompletion",
             "sets the camera's anti-flicker frequency for video recording. precondition: the exposure mode must be program.  note: for the z30 camera, changing anti-flicker will reboot the camera before the setting takes effect.  @param antiflickerfrequency anti-flicker value to set for the camera. see `djicameraantiflickerfrequency` to view all the possible anti-flicker type settings for the camera. @param completion completion block.",
             "getantiflickerfrequencywithcompletion",
             "gets the camera's anti-flicker.  @param antiflickerfrequency the value of the `djicameraantiflickerfrequency` enum. @param error error retrieving the value. @param completion completion block to receive the result.",
             "setsharpness:withcompletion",
             "sets the camera's sharpness. the default value is 0.  @param sharpness sharpness value to be set in the range of [-3, 3]. @param completion asynchronous execution result.",
