             "setdefogenabled:withcompletion",
             "enable/disable defog feature. when defog feature is enabled, the contrast will be enhanced extraordinarily. only supported by z30.  @param enabled `yes` to enable defog feature. @param completion completion block that receives the setter result.",
             "getdefogenabledwithcompletion",
             "gets if defog feature is enabled. it is only supported by z30 camera.  @param enabled the enabled value. @param error error retrieving the value. @param completion completion block to receive the result.",
             "setsaturation:withcompletion",
