             "setthermaldigitalzoomfactor:withcompletion",
             "adjusts the digital zoom. supported only by thermal imaging cameras.  @param factor for resolution 640 x 512, x1,x2,x4,x8 can be set. for resolution 336 x 256, only x1,x2,x4 can be set. please  refer to djicamerathermaldigitalzoomscale in djicamerasettingsdef. @param completion the execution callback with the returned execution result.",
             "getthermaldigitalzoomfactorwithcompletion",
             "gets current digital zoom. supported only by thermal imaging cameras.  @param factor the value of the `djicamerathermaldigitalzoomfactor` enum. @param error error retrieving the value. @param completion completion block to receive the result.",
             "getthermalprofilewithcompletion",
             "gets the thermal imaging camera profile. the profile includes information about resolution, frame rate and focal  length. supported only by thermal imaging cameras.  @param profile the value of the `djicamerathermalprofile` struct. @param error error retrieving the value. @param completion completion block to receive the result.",
             "setthermalspotmeteringtargetpoint:withcompletion",
             "sets the spot metering target point which then changes the `camera:didupdatetemperaturedata` delegate call to  return. this method requires a relative point that is proportional  to the dimension of the camera video dimension, the x, and y values must all be between 0 and 1.0. supported only  by zenmuse xt containing advanced radiometry capabilities.  @param targetpoint the desired target point. @param completion completion block that receives the setter execution result.",
             "getthermalspotmeteringtargetpointwithcompletion",
             "gets the spot metering target point if one is set, if not then returns cgpointzero. supported only by zenmuse  xt containing advanced radiometry capabilities.  @param targetpoint the cgpoint struct. @param error error retrieving the value. @param completion completion block to receive the result.",
             "setthermalmeteringarea:withcompletion",
             "set the metering area for a rectangle inside the thermal image scene, which allows the camera to transmit  aggregate temperature computations via the `camera:didupdateareatemperatureaggregations`  delegate method. see `djicamerathermalareatemperatureaggregations`  for the statistical values that are available. this method requires a relative rect that is proportional to  the rect of the thermal scene, the x, y, width, and height values must all be between 0 and 1.0. supported  only by zenmuse xt containing advanced radiometry capabilities.  @param area the desired thermal metering area. @param completion completion block that receives the setter execution result.",
             "getthermalmeteringareawithcompletion",
             "get a rect representing the currently set metering area for the thermal scene. supported only by zenmuse xt  containing advanced radiometry capabilities.  @param area the cgrect struct. @param error error retrieving the value. @param completion completion block to receive the result.",
             "setthermalffcmode:withcompletion",
             "set the flat-field correction (ffc) mode. supported only by thermal imaging cameras.  @param mode the desired ffc mode. @param completion completion block that receives the setter execution result.",
             "getthermalffcmodewithcompletion",
             "get the currently set flat-field correction (ffc) mode. supported only by thermal imaging cameras with installed  firmware version of 1.15.1.60 or higher.  @param mode the value of the `djicamerathermalffcmode` enum. @param error error retrieving the value. @param completion completion block to receive the result.",
             "triggerthermalffcwithcompletion",
             "trigger flat-field correction. supported only by thermal imaging cameras.  @param completion completion block that receives the execution result of the trigger action.",
             "setthermalcustomexternalscenesettingsprofile:withcompletion",
             "set the custom user profile. this profile represents user-set external  scene parameters for the thermal scene. supported only by thermal  imaging cameras.  @param profile the desired user profile setting. @param completion completion block that receives the setter execution result.",
             "getthermalcustomexternalscenesettingsprofilewithcompletion",
             "get the currently set custom user profile. this profile represents user-set external scene parameters for the  thermal scene. supported only by thermal imaging cameras.  @param profile the value of the `djicamerathermalcustomexternalscenesettingsprofile` enum. @param error error retrieving the value. @param completion completion block to receive the result.",
             "setthermalatmospherictemperature:withcompletion",
             "set the temperature of the atmosphere between the scene and the camera. supported only by zenmuse xt containing advanced radiometry capabilities.  @param temperature the assumed temperature of the atmosphere between the camera and the scene, can be between -50 and 327.67 degrees celsius. @param completion completion block that receives the setter execution result.",
             "setthermalatmospherictransmissioncoefficient:withcompletion",
             "set the transmission coefficient of the atmosphere between the scene and the camera. supported only by zenmuse xt containing advanced radiometry capabilities.  @param coefficient the desired atmospheric temperature, can be between 50 and 100. @param completion completion block that receives the setter execution result.",
             "setthermalbackgroundtemperature:withcompletion",
