             "cancellandingwithcompletion",
             "stops auto-landing of the aircraft. if called before `startlandingwithcompletion` is complete, then the  auto landing will be canceled (`startlandingwithcompletion` completion block will return an error) and  the aircraft will hover at its current location.  @param completion completion block.",
             "confirmlandingwithcompletion",
             "confirms continuation of landing action. when the clearance between the aircraft and the ground is less than  0.3m, the aircraft will pause landing and wait for user's confirmation. can  use `islandingconfirmationneeded`  in `djiflightcontrollerstate` to check if confirmation is needed. it is  supported by flight controller firmware 3.2.0.0 and above.  @param completion completion block to check if confirm landing successful.",
             "isvirtualstickcontrolmodeavailable",
             "indicates whether the virtual stick control interface can be used. virtual stick mode  is only availablle when all of the follow requirements are met:  - virtual stick mode is enabled.  - no waypoint, hotpoint, or follow-me mission is running.  - `djiflightorientationmode` is set to `djiflightorientationmodeaircraftheading`  - terrain-follow is disabled if the aircraft supports this feature.  - tripod mode is disabled if the aircraft supports this feature.  @return `yes` if virtual stick mode is available.",
             "setvirtualstickmodeenabled:withcompletion",
             "enables/disables virtual stick control mode. by enabling virtual stick control mode, the aircraft can be controlled  using `sendvirtualstickflightcontroldata:withcompletion`. not  supported by mavic pro when using the wifi connection.  @param enabled `yes` to enable virtual stick mode. @param completion the execution completion block with the returned execution result.",
             "getvirtualstickmodeenabledwithcompletion",
             "gets virtual stick mode status (enabled/disabled). not supported by mavic pro when using the wifi connection.  @param enabled `yes` if enabled. @param completion the execution completion block with the returned execution result. @param error error (if any) of the operation.",
             "isvirtualstickadvancedmodeenabled",
             "`yes` if virtual stick advanced mode is enabled. by default, it is `no`. assuming gps signal is good, advanced mode will allow aircraft to compensate for wind when hovering.  for the phantom 4, collision avoidance can be enabled for virtual stick  control if advanced mode is on, and collision avoidance is enabled in `djiflightassistant`.  only supported by flight controller firmware versions 3.1.x.x or above.",
