             "sendvirtualstickflightcontroldata:withcompletion",
             "sends flight control data using virtual stick commands. the `isvirtualstickcontrolmodeavailable`  method must return `yes` to use virtual stick commands. virtual stick commands  should be sent to the aircraft between 5 hz and 25 hz. if virtual stick commands are not sent frequently  enough, the aircraft may regard the connection as broken, which will cause the aircraft to hover in place  until the next command comes through.  @param controldata flight control data. @param completion completion block.",
             "flightassistant",
             "intelligent flight assistant. nil if the flight controller doesn't support it.",
             "setflightorientationmode:withcompletion",
             "sets the aircraft flight orientation relative to the aircraft heading, course lock, or home lock. see the  <i>flight controller user guide</i> for more information about flight orientation.  @param type the orientaion mode. @param completion completion block.",
             "lockcourseusingcurrentheadingwithcompletion",
             "locks the current heading of the aircraft as the course lock. used when flight orientation mode  is `djiflightorientationmodecourselock`.  @param completion completion block.",
             "settripodmodeenabled:withcompletion",
             "enables/disables tripod mode. tripod mode drops the aircraft's maximum speed to 2.2mph (3.6kph), and  significantly reduces the control stick sensitivity of the remote controller to give the user the  precision needed for accurate framing. when tripod mode is enabled, missions, terrain follow mode,  course lock, and home lock are not allowed. tripod mode is not allowed if the aircraft is running a  mission. if gps or vision positioning aren't available, tripod mode cannot be enabled. if the gps  and/or the vision system is providing the flight controller with velocity information, the  aircraft will be able to automatically compensate for wind. if however, position information is not  available, manual intervention will be required. user should beware that any manual  compensation will be limited due to the reduced maximum velocity and sensitivity. if gps and vision  position become unavailable while in tripod mode, it is advisable to alert the user and disable tripod mode.  @param enabled `yes` to enable tripod mode. @param completion completion block that receives the setter result.",
             "gettripodmodeenabledwithcompletion",
