             "setcontrolmode:withcompletion",
             "sets the control mode of the flight controller. it is highly recommended you keep the default value  of `djiflightcontrollercontrolmodesmart`. see `djiflightcontrollercontrolmode` for details.  only supported by stand-alone a3.  @param mode control mode to set. @param completion completion block that receives the setter execution result.",
