             "setautoquickspinenabled:withcompletion",
             "enable/disable auto quick spin. when the gimbal reaches a yaw movement limit, the aircraft will  automatically rotate 360 degrees to unwind the gimbal, allowing it to continue moving  in the yaw direction. this method is only available when the aircraft is flying at least 3m above the ground.  @param enabled `yes` to enable auto quick spin. @param completion completion block that receives the setter result.",
             "getautoquickspinenabledwithcompletion",
             "gets current auto quick spin mode (enabled/disabled).  @param enabled `yes` if auto quick spin is enabled. @param error error retrieving the value. @param completion completion block to receive the result.",
             "startgohomewithcompletion",
             "the aircraft will start to go home. the `completion block` will return execution result once this method is invoked.  @param completion completion block.",
             "cancelgohomewithcompletion",
             "the aircraft will stop going home and will hover in place.  @param completion completion block.",
             "sethomelocation:withcompletion",
             "sets the home location of the aircraft. the home location is where the aircraft returns when commanded  by `startgohomewithcompletion`, when its signal is lost or when the battery is below  the lowbatterywarning threshold. the user should be careful setting a new home point location, as  sometimes the product will not be under user control when returning home. a home location  is valid if it is within 30m of one of the following:  - initial take-off location  - aircraft's current location  - current mobile location with at least kcllocationaccuracynearesttenmeters accuracy level  - current remote controller's location as shown by rc gps.  note: if setting home point around mobile location, before calling  this method, the locationservicesenabled must be true in cllocationmanager, the nslocationwheninuseusagedescription or nslocationalwaysusagedescription key needs to be specified in the  applications info.plist and the requestwheninuseauthorization or requestalwaysauthorization method of cllocationmanager object needs to be called to get the user's permission to access location services.  @param homelocation home location latitude and longitude in degrees. @param completion completion block.",
