             "enables/disables upward avoidance. when the inspire 2's upwards-facing infrared sensor detects an obstacle, the  aircraft will slow its ascent and maintain a minimum distance of 1 meter from the obstacle. the  sensor has a 10-degree horizontal field of view (fov) and 10-degree vertical fov. the maximum detection distance is 5m.  @param enabled `yes` to enable the upwards avoidance. @param completion completion block that receives the setter result.",
