             "enables/disables precision landing. when enabled, the aircraft will record its take-off location visually  (as well as with gps). on a return-to-home action the aircraft will attempt to perform a precision landing  using the additional visual information. this method only works on a return-to-home action when the home  location is successfully recorded during take-off, and not changed during flight.  @param enabled `yes` to enable the precise landing. @param completion completion block that receives the setter result.",
