             "loadmission",
             "loads a waypoint mission into the operator. a mission can be loaded only when the `djiwaypointmissionstate` is one of the following:  - `djiwaypointmissionstatereadytoupload`  - `djiwaypointmissionstatereadytoexecute`  calling `loadmission` when the current state is `djiwaypointmissionstatereadytoexecute` will change the state to `djiwaypointmissionstatereadytoupload`. after calling `loadmission`, `latestexecutionprogress` will be reset to `nil`.  @param mission waypoint mission to load.  @return returns an error when mission data is invalid or the mission cannot be loaded in the current state.",
             "loadedmission",
             "gets the currently loaded mission of the operator. there are two ways to load a mission. 1. a mission can be loaded by user through `loadmission`. 2. if the aircraft is already executing a waypoint mission when sdk is re-connected, the operator will download part of the mission's information from the aircraft and load it automatically. in that case, the loaded mission will only contain the summary of the executing mission but information for each waypoint is absent. user can call `downloadmissionwithcompletion` to get all the information for the loaded mission. the `loadedmission` will be reset to `nil` when the execution of the loadedmission is stopped, finished or interrupted.",
             "uploadmissionwithcompletion",
             "starts to upload the `loadedmission` to the aircraft. it can only be called when the `loadedmission` is complete and the `currentstate` is `djiwaypointmissionstatereadytoupload`. if a timeout error occurs during the previous upload, the upload operation will resume from the previous break-point. after a mission is uploaded successfully, the `djiwaypointmissionstate` will become `djiwaypointmissionstatereadytoexecute`.  @param completion completion block that will be called when the upload operation succeeds or fails to start. if it is started successfully, use `addlistenertouploadevent:withqueue:andblock` to receive the detailed progress.",
             "downloadmissionwithcompletion",
             "downloads information of each waypoint from aircraft and save it to `loadedmission`. if a download operation is started, the operator will download the information of waypoints missing in `loadedmission` one-by-one in ascending order. if `loadedmission` is already complete (containing all the waypoints), this method will call `completion` immediately without error. it can only be called when the `currentstate` is one of the following: - `djiwaypointmissionstateexecuting` - `djiwaypointmissionstateexecutionpaused`  @param completion completion block that will be called when the download operation succeeds or fails to start. if it is started successfully, use `addlistenertodownloadevent:withqueue:andblock` to receive the detailed progress.",
             "startmissionwithcompletion",
