             "resumemissionwithcompletion",
             "resumes the paused mission. it can only be called when the `currentstate` is `djiwaypointmissionstateexecutionpaused`. after a mission is resumed successfully, the `currentstate` will become `djiwaypointmissionstateexecuting`.  @param completion completion block that will be called when the operator succeeds or fails to resume the mission. if it fails, an error will be returned.",
