             "setautoflightspeed:withcompletion",
             "set the flight speed while the mission is executing automatically (without manual joystick speed input). this is the only property or method in this class that can communicate with the aircraft during a mission. all other properties and methods are used offline to prepare the mission which is then uploaded to the aircraft.  @param speed auto flight speed to be set. the absolute value of the auto flight speed should be less than or equal to the `maxflightspeed`. its range is [-`maxflightspeed`, `maxflightspeed`] m/s. @param completion completion block.",
