                   "#DJISDKManager_startConnectionToProduct_inline",
                   "Starts a connection between the SDK and the DJI product. This method should be called  after successful registration of the app and once there is a data connection between the mobile device and DJI product. This data connection is either a USB cable connection, a WiFi connection (that needs to be established outside of the SDK) or a Bluetooth connection (that needs to be established with `bluetoothProductConnector`). If the connection succeeds, `productConnected` will be called if the connection succeeded. Returns `YES` if the connection is started successfully. For products which connect to the mobile device using Bluetooth, `bluetoothProductConnector` should be used to get a `DJIBluetoothProductConnector` object which can handle Bluetooth device connection.  @return `YES` if the connection is started successfully.",
