                   "Sets the Digital Data Enhancement index (for DDE dynamic mode). DDE can be used to enhance image details (sharpen,  higher index) and/or suppress fixed pattern noise (soften, lower index). It can be set manually only when the Scene  mode is Manual, User1, User2 or User3. Supported only by thermal imaging cameras.  @param value Integer in range [-20, 100]. Values less than 0 soften the image and filter fixed pattern noise. Values greater  than 0 sharpen the details in the image. Value of 0 results in no enhancement. @param completion Completion block that receives the getter execution result.",
