                   "/Components/FlyZoneManager/DJIFlyZoneManager.html",
                   "#DJIFlyZoneManager_enableIndividualUnlockZone_inline",
                   "Enables an Individual Unlock zones that is on the aircraft. All Individual Unlock zones  on the aircraft can be retrieved with `getIndividualUnlockZonesWithCompletion`.  At any time, only one Individual Unlock zone can be enabled. Enabling an Individual Unlock  zone will disable the previously enabled zone. This method can only be used when `isIndividualUnlockZoneSupported` is `YES`.  @param zone Individual Unlock zone to enabled. If `zone` is `nil`, only the previously enabled zone  will be disabled. @param completion `completion block` to receive the result.",
