                   "/Components/Missions/DJIActiveTrackMissionOperator.html",
                   "#DJIActiveTrackMissionOperator_setCircularSpeed_inline",
                   "Setting a non-zero speed starts the aircraft circling the target. Speed can be set within the range [-5, 5] m/s where a positive speed is a counter-clockwise movement (when viewing from the top). Reverting the speed to 0 m/s ends the circling movement. It can only be called when the `currentState`  is `DJIActiveTrackMissionStateAircraftFollowing` and `trackingMode`  is `DJIActiveTrackModeTrace`.  @param speed Circular speed to set in m/s. @param completion Completion block that will be called when the operation succeeds or fails.  If it fails, an error will be returned.",
