                   "#DJIWaypoint_addAction_inline",
                   "Adds a waypoint action to a waypoint. The number of waypoint actions should not be larger  than `DJIMaxActionCount`. The action will only be executed when the mission's `flightPathMode` property is set  to `DJIWaypointMissionFlightPathNormal` and will not be executed when the mission's `flightPathMode` property is set  to `DJIWaypointMissionFlightPathCurved`. The maximum number of waypoint  actions you can add is 15.  @param action Waypoint action to be added to the waypoint.  @return `YES` if the waypoint action has been added to the waypoint. `NO`  if the waypoint action count is too high, or if the waypoint action was incorrectly setup.",
